import React from 'react';
import Props from './Props';

const name=["Pranish","Prapti","Bhagat","Karki"];

const Demo=()=>
{
    return(
    <>
    {
    name.map((val) =>
    {
        return(<Props a={val}/>
        );
    })
    }

    </>
    );
}

export default Demo;
